// константы
const FOLLOW = 'FOLLOW';
const UNFOLLOW = 'UNFOLLOW';
const SET_USERS = 'SET_USERS';

let initialState = {
   users: [
      {id:1, fullname: 'Vasya Patron', 
      avatar: 'data:image/jpeg;base64,',
      status:'Hi. I am good. Thx', follow:true},
      {id:2, status:'Go Go Go',
      fullname: 'Vasya Patron', 
      avatar: 'data:image/jpeg;base64,',
      follow:false},
      {id:3, fullname: 'Vasya Patron', 
      avatar: 'data:image/jpeg;base64,',
      status:'Go Go Go', follow:false}
   ]
};

let usersReducer = (state = initialState, action) => {

   switch (action.type) {

      case SET_USERS:
         return {
            ...state,
            users:[...state.users, ...action.users]
         };

      case FOLLOW:

         return {
            ...state
         };
      default:
         return state;
   }
}


//action creator можно просто импортировать в компоненты
export const followAC = (userID) => ({type:FOLLOW, id:userID}); 
export const unfollowAC = () => ({type:UNFOLLOW}); 
export const setUsersAC = (users) => ({type:SET_USERS, users:users}); 

export default usersReducer;